import CheckOff from '../../assets/images/icon_checkbox_16px_off.svg';
import CheckOn from '../../assets/images/icon_checkbox_16px_on.svg';

const AgreeAll = () => {
    return(
        <div className='flex items-center mt-4'>
            <div className='border w-[18px] h-[18px] rounded-full flex justify-center items-center'>
                <button >
                    <img src={CheckOff} alt={'off'}/>
                </button>
            </div>
            <h2 className='title_text text-[15px] ml-2 pb-1'>[전체] 전체동의</h2>
        </div>
    )
}
export default AgreeAll;
